import React from "react";
import { Form } from "antd";

const UserProfile = () => {
  return (
    <Form>
      <div>
        <Form.Item htmlFor="user-id"></Form.Item>
      </div>
      <div></div>
      <div></div>
    </Form>
  );
};
export default UserProfile;
